import React, { useState, useEffect } from 'react';
import roles from '../../data/role.json';
import './AdminPage.css';  // Ensure this file contains your CSS styles

const AdminPage = () => {
  const [newUserUsername, setNewUserUsername] = useState('');
  const [newUserPassword, setNewUserPassword] = useState('');
  const [newUserRole, setNewUserRole] = useState('user');
  const [availableRoles, setAvailableRoles] = useState([]);
  const [users, setUsers] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    setAvailableRoles(roles.roles.map(role => role.role));
    const storedUsers = localStorage.getItem('users');
    if (storedUsers) {
      setUsers(JSON.parse(storedUsers));
    }
  }, []);

  const addUser = (username, password, role) => {
    const newUser = { username, password, role };
    const updatedUsers = [...users, newUser];
    setUsers(updatedUsers);
    localStorage.setItem('users', JSON.stringify(updatedUsers));
  };

  const handleDeleteUser = (username) => {
    const updatedUsers = users.filter(user => user.username !== username);
    setUsers(updatedUsers);
    localStorage.setItem('users', JSON.stringify(updatedUsers));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (newUserUsername && newUserPassword && newUserRole) {
      addUser(newUserUsername, newUserPassword, newUserRole);
      setNewUserUsername('');
      setNewUserPassword('');
      setNewUserRole('user');
      setError(null);
    } else {
      setError('Please fill in all fields');
    }
  };

  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-md-3">
          <div className="card">
            <div className="card-header">Menu</div>
            <div className="card-body">
              <ul className="nav flex-column">
                <li className="nav-item">
                  <a className="nav-link active" href="#">Add New User</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#">Manage Users</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#">Settings</a>
                </li>
              </ul>
            </div>
          </div>
        </div>
        <div className="col-md-9">
          <div className="card">
            <div className="card-header">Add New User</div>
            <div className="card-body">
              <form onSubmit={handleSubmit}>
                <div className="form-group">
                  <label htmlFor="newUserUsername">Username:</label>
                  <input 
                    type="text" 
                    className="form-control" 
                    id="newUserUsername" 
                    value={newUserUsername} 
                    onChange={(e) => setNewUserUsername(e.target.value)}
                    required
                  />
                </div>
                <div className="form-group">
                  <label htmlFor="newUserPassword">Password:</label>
                  <input 
                    type="password" 
                    className="form-control" 
                    id="newUserPassword" 
                    value={newUserPassword} 
                    onChange={(e) => setNewUserPassword(e.target.value)}
                    required
                  />
                </div>
                <div className="form-group">
                  <label htmlFor="newUserRole">Role:</label>
                  <select 
                    className="form-control" 
                    id="newUserRole" 
                    value={newUserRole} 
                    onChange={(e) => setNewUserRole(e.target.value)}
                  >
                    {availableRoles.map(role => (
                      <option key={role} value={role}>{role}</option>
                    ))}
                  </select>
                </div>
                {error && <div className="alert alert-danger">{error}</div>}
                <button type="submit" className="btn btn-primary">Add User</button>
              </form>
            </div>
          </div>
          <div className="card mt-4">
            <div className="card-header">Users</div>
            <div className="card-body">
              <table className="table table-striped">
                <thead>
                  <tr>
                    <th scope="col">#</th>
                    <th scope="col">Username</th>
                    <th scope="col">Role</th>
                    <th scope="col">Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {users.map((user, index) => (
                    <tr key={user.username}>
                      <th scope="row">{index + 1}</th>
                      <td>{user.username}</td>
                      <td>{user.role}</td>
                      <td>
                        <button 
                          className="btn btn-sm btn-danger" 
                          onClick={() => handleDeleteUser(user.username)}
                        >
                          Delete
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminPage;
